import React from "react";
import Ticker from "./Ticker";
import Draggable from 'react-draggable';

const Tickers = ({ tickers, onDelete }) => {
  return (
    <>
      <Draggable
        axis="x"
        handle=".handle"
        defaultPosition={{ x: 0, y: 0 }}
        position={null}
        grid={[25, 25]}
        scale={1}
        onStart={handleStart}
        onDrag={handleDrag}
        onStop={handleStop}>
        <div>
          <div className="handle">
            {tickers.map((ticker) => (
              <Ticker
                key={ticker.id}
                ticker={ticker}
                onDelete={() => onDelete(ticker.id)}
              >
                {ticker.tickername}
              </Ticker>
            ))}</div>
          <div>This readme is really dragging on...</div>
        </div>
      </Draggable>

      {tickers.map((ticker) => (
        <Ticker
          key={ticker.id}
          ticker={ticker}
          onDelete={() => onDelete(ticker.id)}
        >
          {ticker.tickername}
        </Ticker>
      ))}
    </>
  );
};

export default Tickers;
